jQuery.extend(jQuery.fn.dataTableExt.oSort,{"ip-address-pre":function(E){var C=E.split("."),D="";for(var A=0;A<C.length;A++){var B=C[A];if(B.length==1){D+="00"+B}else{if(B.length==2){D+="0"+B}else{D+=B}}}return D},"ip-address-asc":function(B,A){return((B<A)?-1:((B>A)?1:0))},"ip-address-desc":function(B,A){return((B<A)?1:((B>A)?-1:0))}});